void init_students()
{
	int i;

	for (i=0; i<MAX_STUDENTS; i++)
	{
		strcpy(students[i].ip_address, "");
		strcpy(students[i].student_id, "");
		students[i].test_number = 0;
		students[i].mark = 0;
	}
}


int findIPaddress(char *ipaddress)
{
	int rc;
	int i;

	rc = -1;

	for (i=0; i<MAX_STUDENTS; i++)
	{
		if (rc == -1)
		{
			if (strlen(students[i].ip_address) == 0)
			{
				rc = i;  // New entry
			}
			else if (strcmp(students[i].ip_address, ipaddress) == 0)
			{
				rc = i;  // Existing entry
			}
		}
	}

	return rc;
}




void save_mark(char* student_id, int mark)
{
	FILE *ofp;
	time_t current_time;
	char* c_time_string;
	int  i;

	if ( ( ofp = fopen( "UFCF93 Assignment 1 Marks.txt", "a" ) ) != NULL ) 
	{
		current_time = time(NULL);
		c_time_string = ctime(&current_time);

		for (i=0; i<strlen(c_time_string); i++)
		{
			if (c_time_string[i] == '\n')
			{
				c_time_string[i] = '\0';
			}
		}
		fprintf(ofp, "%s> %s - %d/60 \n", c_time_string, student_id, mark);
		for(int y = 0; y < MAX_TESTS;y++){
		if(passed[y] == true)
		fprintf(ofp, "Test %d - Passed\n",y);
		if(passed[y] == false)
		fprintf(ofp, "Test %d - Failed\n",y);
		}
		fclose(ofp);
	}
}


int _tmain(int argc, _TCHAR* argv[])
{
	SOCKADDR_IN server_addr;
	SOCKADDR_IN client_addr;
	SOCKET  sock;	// This is our socket, it is the handle to the IO address to read/write packets
	WSADATA data;
	char inbuffer[2056];
	char buffer[2056];
	int  len = sizeof(client_addr);
	char student_id[20];
	long answer_ab;
	long answer_fm1;
	long answer_ix;
	long answer_sp;
	long answer_m2m3;
	long answer_m4m5;
	int  student_index;
	int  test_index;
	int  running_score;
	FILE* ofp;

	printf("\n");
	printf("Microprocessor Emulator Marking Server\n");
	printf("UWE Computer and Network Systems Assignment 1\n");
	printf("\n");

	init_students();

	// First we see if there is a winsock ver 2.2 installed on the computer,
	// we initizalize the sockets DLL for out app.
	if (WSAStartup(MAKEWORD(2, 2), &data) != 0) return(0);

	sock = socket(AF_INET, SOCK_DGRAM, IPPROTO_UDP);
	if (!sock)
	{
	 // Creation failed!
	}

	memset(&server_addr, 0, sizeof(SOCKADDR_IN));
	server_addr.sin_family = AF_INET; // Must be AF_INET
	server_addr.sin_addr.s_addr = INADDR_ANY; // Means we will "answer" to all addresses.
	//server_addr.sin_addr.s_addr = inet_addr("127.0.0.1"); // IP to communicate with.
	server_addr.sin_port = htons(PORT_SERVER);

	memset(&client_addr, 0, sizeof(SOCKADDR_IN));
	client_addr.sin_family = AF_INET;
	client_addr.sin_addr.s_addr = inet_addr("127.0.0.1");
	client_addr.sin_port = htons(PORT_CLIENT);



	int ret = bind(sock, (SOCKADDR *)&server_addr, sizeof(server_addr));
	if (ret)
	{
	   printf("Bind failed! \n");  // Bind failed!
	}

	while(1)
	{
		printf("Waiting... \n");

		memset(inbuffer, '\0', sizeof(inbuffer));
		if (recvfrom(sock, inbuffer, sizeof(inbuffer)-1, 0, (SOCKADDR *)&client_addr, &len) != SOCKET_ERROR)
		{
			printf("Incoming Data: %s \n", inbuffer);  // THERE ARE NO SOCKET ERRORS!
			printf("Client address = %s \n", inet_ntoa(client_addr.sin_addr));

			student_index = findIPaddress(inet_ntoa(client_addr.sin_addr));

			if ((student_index >= 0) && (student_index < MAX_STUDENTS))
			{
				if (sscanf(inbuffer, "Test Student %s", &student_id) == 1)
				{
					// Initiate Test

					strcpy(students[student_index].student_id, student_id);
					strcpy(students[student_index].ip_address, inet_ntoa(client_addr.sin_addr));
					students[student_index].test_number = 0;
					students[student_index].mark = 0;
				}
				else if (sscanf(inbuffer, "%04X %04X %04X %04X %04X %04X", &answer_ab, &answer_fm1, &answer_ix, &answer_sp, &answer_m2m3, &answer_m4m5) == 6)
				{
					/*
					if ( ( ofp = fopen( "answers.txt", "a" ) ) != NULL ) 
					{
						fprintf(ofp, "0x%04X, 0x%04X, 0x%04X, 0x%04X, 0x%04X, 0x%04X\n", answer_ab, answer_fm1, answer_ix, answer_sp, answer_m2m3, answer_m4m5);
						fclose(ofp);
					}
					*/
					// Check results

					test_index    = students[student_index].test_number;
					running_score = 0;//students[student_index].mark;


					if ((test_index >= 0) && (test_index < MAX_TESTS))
					{
						if (((tests[test_index].b1 << 8) |  tests[test_index].b2) == (answer_ab))
						{
							running_score+=2;
						}
						if (((tests[test_index].b3 << 8) |  tests[test_index].b4)  == (answer_fm1))
						{
							running_score+=2;
						}

						if (((tests[test_index].b5 << 8) |  tests[test_index].b6)  == (answer_ix))
						{
							running_score+=2;
						}
						if (((tests[test_index].b7 << 8) | tests[test_index].b8) == (answer_sp))
						{
							running_score+=2;
						}

						if (((tests[test_index].b9 << 8) |  tests[test_index].b10)  == (answer_m2m3))
						{
							running_score+=2;
						}
						if (((tests[test_index].b11 << 8) |  tests[test_index].b12)  == (answer_m4m5))
						{
							running_score+=2;
						}

						}
					if(running_score == TEST_LENGTH) {
						students[student_index].mark++;
						passed[test_index] = true;
					}
					running_score = 0;
					students[student_index].test_number = test_index + 1;
				}
				else
				{
					// Error
				}

				test_index = students[student_index].test_number;

				if ((test_index >= 0) && (test_index < MAX_TESTS))
				{
					printf("Sending Test... \n");
					strcpy(buffer, tests[test_index].program);
					if (sendto(sock, buffer, strlen(buffer), 0, (SOCKADDR *)&client_addr, sizeof(SOCKADDR)) == SOCKET_ERROR)
					{
						printf("Failed to send message\n");
					}
				}
				else
				{
					printf("Sending Testing passed... \n");
					//strcpy(buffer, "Testing passed");
					sprintf(buffer, "Tests passed %d", students[student_index].mark);
					if (sendto(sock, buffer, strlen(buffer), 0, (SOCKADDR *)&client_addr, sizeof(SOCKADDR)) == SOCKET_ERROR)
					{
						printf("Failed to send message\n");
					}
					printf("Sending Testing complete... \n");
					//strcpy(buffer, "Testing complete");
					sprintf(buffer, "Testing complete %d", (students[student_index].mark * 60) / (MAX_TESTS));
					if (sendto(sock, buffer, strlen(buffer), 0, (SOCKADDR *)&client_addr, sizeof(SOCKADDR)) == SOCKET_ERROR)
					{
						printf("Failed to send message\n");
					}
					printf("Student %s mark = %d\n", students[student_index].student_id, (students[student_index].mark * 60) / (MAX_TESTS));
					save_mark(students[student_index].student_id, (students[student_index].mark * 60) / (MAX_TESTS));
				}
			}
			else
			{
				printf("Sending Error... \n");
				strcpy(buffer, "Error");
				if (sendto(sock, buffer, strlen(buffer), 0, (SOCKADDR *)&client_addr, sizeof(SOCKADDR)) == SOCKET_ERROR)
				{
					printf("Failed to send message\n");
				}
			}
		}
	}

	printf("Exiting... \n");

	closesocket(sock);
	WSACleanup();

	getchar();

	return 0;
}


